  //     </div>
  //   );
  // };
  return (
    <div className="bg-red-200 r-wrapper py-4">
      <div className="r-container gap-4  ">
        {/* cake  */}
        <div className="flex gap-y-8 justify-center items-center flex-wrap">
          <img src="https://theme.hstatic.net/200000411281/1000949882/14/icon-title-home-featured-product.png?v=240" />
        </div>

        <span className=" text-[#ffa500] text-3xl font-semibold">
          Sản phẩm nổi bật
        </span>
        <p className="text-[#8c8b8b] text-[1.5rem]">
          Cập nhật về những sản phẩm nổi bật nhất từ Fresh Garden
        </p>
        <div className=" flex ">
          {/* <PropertyCard /> */}
          <div className="card ">
            <img src="https://anhquanbakery.com/uploads/images/banh-macaron-nhan-kem-socola-ganache-sieu-de-thuong.jpg" />
            <span></span>
          </div>
          <div className="card ">
            <img src="https://i.pinimg.com/originals/b0/b7/c8/b0b7c83a0fc3bc2c8985439569cab943.png" />{" "}
          </div>
          <div className="card ">
            <img src="https://naidecor.vn/wp-content/uploads/2020/01/banh-kem-tam-giac-mo-phong-trung-bay-su-kien-1.jpg" />
          </div>
          <div className="card ">
            <img src="https://www.menudep.com/images/photography/800x500/20200204/145688445-chup-hinh-banh-ngot_08.jpg" />
          </div>
        </div>
        {/* sinh nhat cake  */}
      </div>
    </div>
  );
};

export default Residencies;
